import React from "react";
import ShadingPanel from "../components/ShadingPanel";

export default function HomePage() {
  return (
    <div style={{ padding: 24 }}>
      <h1 style={{ marginBottom: 16 }}>מערכת ניהול סנסורים וקמפוס</h1>
      <ShadingPanel />
    </div>
  );
}
